INSERT INTO `field_data_field_technical_information` VALUES ('bean','ia_theme_information',0,1,6,'und',0,'Clicking the site logo will take the user to the homepage of the site. Clicking the show/hide toggle will be visible on mobile and hidden on tablet and desktop. Clicking the toggle will toggle an \"open\" class on the header for use in displaying open/close functionality on the header elements.','filtered_html'),('bean','ia_theme_information',0,2,7,'und',0,'These menus will be displayed as menu blocks.','filtered_html'),('bean','ia_theme_information',0,3,5,'und',0,'The main navigation will be a menu block.','filtered_html'),('bean','ia_theme_information',0,4,8,'und',0,'Breadcrumbs are created through the crumbs module. Page title moved from content region dynamically via a view (typically called \"page_content_alternate_locations\" or similar). Other dynamic elements such as the billboard and alerts added through views.','filtered_html'),('bean','ia_theme_information',0,5,12,'und',0,'Content may be entered via static or dynamic blocks or on a node-level by utilizing the \"page alternate locations\" view to distribute content.','filtered_html'),('bean','ia_theme_information',0,6,11,'und',0,'Content may be entered via static or dynamic blocks or on a node-level by utilizing the \"page alternate locations\" view to distribute content.','filtered_html'),('bean','ia_theme_information',0,8,14,'und',0,'The footer navigation will be created by a menu block.','filtered_html'),('bean','ia_theme_information',0,9,16,'und',0,'Content will be displayed via static blocks.','filtered_html'),('bean','ia_theme_information',0,10,17,'und',0,'Subnav is created via menu blocks, and contains active, active-trail, expanded, and leaf classes.','filtered_html'),('bean','ia_theme_information',0,11,18,'und',0,'May use the \"page content alternate locations\" view to pull content from the node.','filtered_html'),('bean','ia_theme_information',0,12,19,'und',0,'n/a','filtered_html'),('bean','ia_theme_information',0,13,20,'und',0,'n/a','filtered_html'),('bean','ia_theme_information',0,14,21,'und',0,'n/a','filtered_html');
